import './App.js'
import createSudoku  from './App.js'
import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'
let sudoku=createSudoku()

const root=ReactDOM.createRoot(document.getElementById('root'));
class Start extends React.Component{
  constructor(){
    super()
  }
  func=()=>{
    root.render(<Sudoku arr={sudoku} />)
  }
  render(){
    return (<button className='startButton'onClick={this.func}>
      CLICK TO START
    </button>)
  }
}
let i=0,j=0;
let count=0;
let render=(arr)=>{
  let fin=[]
  for(let i=0;i<arr.length;i++)
  {

       fin.push(<div className='Sudoku'><Row arra={arr[i]} id={count++}/><br/></div>)
  }
  return fin;
}
class Sudoku extends React.Component{
     constructor(props)
     {
      super(props);
     }

     render(){
         return render(this.props.arr);
     }
}
class Row extends React.Component{
  constructor(props){
    super(props)
  }
  render(){
    return (
      this.props.arra.map((temp)=>
     { if(temp!==-1)
      return <Element val={temp}/>
      else
      return <Input id={this.props.id} />
     }))
  }
}
class Element extends React.Component{
  constructor(props)
  {
    super(props)
  }
  render(){
    return (
      <div className='Element'>
        {this.props.val}
      </div>
    )
  }
}
class Input extends React.Component{
  constructor(props){
    super(props);
    this.state={"row":this.props.id}
  }
  func=(e)=>{
    let v=e.target.value
    alert(v);
  }
  render(){
    return (
      <input type="text"  className="Element1" onKeyUp={this.func}/>
    )
  }
}
root.render(<Start/>)
